import React from 'react';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';

function ToDo( { task, completed }){
  return (
    <ListItem>
      <ListItemText>
        {task}
      </ListItemText>
    </ListItem>
  )
}

export default ToDo;
